Qualies down. Finals tomorrow. 🏁 

After a fast and dusty Practice and Timed Training session on the revamped Maribor track yesterday, riders found more of the same today for Qualies.

With only a few lines to choose from, riders were tasked with finding consistency on a treacherous track that has already knocked many of the world's best from competition due to injury. 

Today our athletes took 4 of the 5 top spots for both Elite Men and Elite Women. 

It was also a big day for our Juniors as @graceyhemstreet and @jordanwilliams17 posted the fastest qualifying times in their respective categories.☝️

